script: |
  super -f text -I q143.spq | sort > q143.out

inputs:
  - name: q143.spq
    data: |
      SELECT DISTINCT + ( - - col0 ) + - + 64 + + 77 * + 6 FROM tab1 (FORMAT parquet) WHERE NOT col1 / col0 + - col1 * + + col0 IS NULL;
  - name: tab1

outputs:
  - name: q143.out
    data: |
      449
      483
      489
